    /**
     * @param string $class
     * @param string $expectedResult
     *
     * @dataProvider getTableDataProvider
     */
    public function testTable($class, $expectedResult): void
    {
        /** @var AbstractCRC8 $crcClass */
        $crcClass = new $class();
        $calculatedResult = $crcClass->populateTable();

        $this->assertEquals($expectedResult, $calculatedResult);
    }

    /**
     * @return array[]
     */
    public function getTableDataProvider(): array
    {
        $tests = [];

        foreach (self::$tests as $item) {
            $tests[] = [
                'class' => $item['class'],
                'result' => $item['result'],
            ];
        }

        return $tests;
    }
}
